import React from 'react';

//style
import FooterContainer from '../../styles/02_tools/styled_component/components/FooterContainerStyle';
import { Note } from '../../styles/02_tools/styled_component/components/Fonts';

//files
import resume from '../../files/resume_01.29.20.pdf';

function Footer() {
  return (
    <FooterContainer className="footer">
      <Note className="copyright">
        Copyright Â© 2020 Noah Jung. <br />
        All rights reserved. <br />
        Developed using React.
      </Note>
      <div className="links">
        <a href="mailto:noahsjung@gmail.com">Email</a>
        <a href={resume} target="blank">
          Resume
        </a>
        <a href="https://www.linkedin.com/in/noahsjung/" target="blank">
          LinkedIn
        </a>
      </div>
    </FooterContainer>
  );
}

export default Footer;
